const $AXT = { "get": { "serialArray": (n, x) => [...Array(x - n + 1).keys()].map(i => i + n) }, "math": { "distance": (p1, p2) => Math.sqrt((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2) }, "is": { "object": i => !!i && typeof i === 'object', "primitive": i => !i || typeof i !== 'object', "falsy": i => !i, "truthy": i => !!i, "existItem": (f, ...i) => i.includes(f), "nullish": i => i == null }, "func": { "sleep": s => new Promise(resolve => setTimeout(resolve, 1000 * s)) } }